import { createNativeStackNavigator } from "@react-navigation/native-stack";
import ScheduleMainScreen from "../shared/ScheduleMainScreen";
import ScheduleContainerScreen from "../shared/ScheduleContainerScreen";

const AuthenticationStack = createNativeStackNavigator();

export default function ScheduleStacksScreen() {
  return (
    <AuthenticationStack.Navigator
      initialRouteName="Schedule"
      screenOptions={{
        animation: "slide_from_right",
      }}
    >
      <AuthenticationStack.Screen
        name="Schedule_Home"
        component={ScheduleMainScreen}
        options={{
          title: "Schedules",
        }}
      />
      <AuthenticationStack.Screen
        name="Schedule_Container"
        component={ScheduleContainerScreen}
        options={{
          title: "Details",
        }}
      />
    </AuthenticationStack.Navigator>
  );
}
